import '../css/mascot.css';
import mascot from '../image/mascot.png';

function Mascot() {
  return (
    <div className="Mascot">
      <img src={mascot} width='400pt' />
      <div className="invite"><p><b>แล้วมากินเจด้วยกันนะฮะ</b></p></div>
    </div>
  );
}

export default Mascot;
